    // linkArray.push("/Portfolio");
    // linkArray.push("/Contact");
    // linkArray.push("/Experience");
    const linkArray = [
        {
            image: searchicon,
            link: "/AboutMe",
        },
        {
            image: foldericon,
            link: "/Portfolio",
        },
        {
            image: mailicon,
            link: "/Contact",
        },
        {
            image: capicon,
            link: "/Experience",
        },
    ];

    var second_btn = props.second;
    var third_btn = props.third;
    var fourth_btn = props.fourth;

    return(
        <div className="Navbar">
            {/* The first button is always the home button */}
            <Link to="/">
                <img className="button" src={homeicon}/>
            </Link>

            {/* Use the array of links to get the second, third and fourth links for this specific page */}
            {/* <Link to={linkArray[second_btn]}>
                <img className="button" src={imageArray[second_btn]}/>
            </Link>
            <Link to={linkArray[third_btn]}>
                <img className="button" src={imageArray[third_btn]}/>
            </Link>
            <Link to={linkArray[fourth_btn]}>
                <img className="button" src={imageArray[fourth_btn]}/>
            </Link> */}

            <Link to={linkArray[second_btn].link}>
                <img className="button" src={imageArray[second_btn].image}/>
            </Link>
            <Link to={linkArray[third_btn].link}>
                <img className="button" src={imageArray[third_btn].image}/>
            </Link>
            <Link to={linkArray[fourth_btn].link}>
                <img className="button" src={imageArray[fourth_btn].image}/>
            </Link>
        </div>
    );
}

export default Navbar;
